import React from "react";

export const Logout = () => {
    const Logout = () => {
  
        setIsLoggedIn(false);
        setUsername('');
        setPassword('');
        setTimeout(() => {
            window.location.href = "/Login";
          }, 3 * 1000);
    }
    return (
      <div className="Logout">
        <h1>ログアウトしました</h1>
        <Logout/>
        <br/>
      </div>
    );
  };
  
export default Page1
